import Features from "./components/features";
import Header from "./components/header";
import Chart from "./components/graph";
import "./App.css";

function App() {
  let state = {
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  return (
    <div className="App">
      <Header />
      <Features state={state} />
      {console.log(state)}
      <Chart />
    </div>
  );
}

export default App;
